const { chromium } = require('playwright');

const TARGET_URL = 'http://localhost:3000';

// Generate unique credentials
const timestamp = Date.now();
const uniqueEmail = `user_${timestamp}@securemail.dev`;
const securePassword = `S3cur3P@ss_${timestamp}!`;

(async () => {
  const browser = await chromium.launch({ headless: false, slowMo: 150 });
  const page = await browser.newPage();

  try {
    // ===== STEP 1: Register a new account =====
    console.log('\nðŸ“ STEP 1: Registering new account...');
    console.log(`Email: ${uniqueEmail}`);
    console.log(`Password: ${securePassword}`);

    await page.goto(`${TARGET_URL}/login`);
    await page.waitForTimeout(1000);

    // Click Register tab
    await page.click('button:has-text("Register")');
    await page.waitForTimeout(500);

    // Fill registration form
    await page.fill('input[type="email"]', uniqueEmail);
    await page.fill('input[type="password"]', securePassword);

    // Take screenshot before submitting
    await page.screenshot({ path: '/tmp/01-register-form.png', fullPage: true });

    // Submit registration
    await page.click('button:has-text("Enter System")');
    await page.waitForTimeout(2000);

    // Check if registration was successful
    await page.screenshot({ path: '/tmp/02-after-register.png', fullPage: true });
    console.log('âœ… Registration submitted');
    console.log('Current URL:', page.url());

    // ===== STEP 2: Navigate to Index to add games =====
    console.log('\nðŸŽ® STEP 2: Adding 5 games with rating 9...');

    // Go to Index page to search for games
    await page.click('a:has-text("Index"), a:has-text("INDEX")');
    await page.waitForTimeout(1500);
    await page.screenshot({ path: '/tmp/03-index-page.png', fullPage: true });

    // List of games to add
    const gamesToAdd = [
      'The Legend of Zelda',
      'Super Mario Bros',
      'Final Fantasy',
      'Metal Gear Solid',
      'Dark Souls'
    ];

    for (let i = 0; i < gamesToAdd.length; i++) {
      const game = gamesToAdd[i];
      console.log(`\nAdding game ${i + 1}/5: ${game}`);

      // Search for the game
      const searchInput = page.locator('input[type="search"], input[placeholder*="search" i], input[placeholder*="Search" i]').first();
      if (await searchInput.isVisible()) {
        await searchInput.clear();
        await searchInput.fill(game);
        await page.waitForTimeout(1500);
      }

      await page.screenshot({ path: `/tmp/04-search-${i + 1}.png`, fullPage: true });

      // Click on the first game result to open details/add dialog
      const gameCard = page.locator('[data-testid="game-card"], .game-card, article, [class*="card"]').first();
      if (await gameCard.isVisible()) {
        await gameCard.click();
        await page.waitForTimeout(1000);
      }

      await page.screenshot({ path: `/tmp/05-game-detail-${i + 1}.png`, fullPage: true });

      // Look for Add to Collection button or similar
      const addButton = page.locator('button:has-text("Add"), button:has-text("Collection"), button:has-text("+")').first();
      if (await addButton.isVisible()) {
        await addButton.click();
        await page.waitForTimeout(1000);
      }

      await page.screenshot({ path: `/tmp/06-add-dialog-${i + 1}.png`, fullPage: true });

      // Set rating to 9
      // Try different rating selectors
      const ratingInput = page.locator('input[type="number"], input[name*="rating" i], input[placeholder*="rating" i]').first();
      if (await ratingInput.isVisible()) {
        await ratingInput.clear();
        await ratingInput.fill('9');
      } else {
        // Try clicking on rating stars or slider
        const ratingStar = page.locator('[data-rating="9"], button:has-text("9"), [aria-label*="9"]').first();
        if (await ratingStar.isVisible()) {
          await ratingStar.click();
        }
      }

      await page.waitForTimeout(500);

      // Confirm adding the game
      const confirmButton = page.locator('button:has-text("Save"), button:has-text("Add"), button:has-text("Confirm"), button[type="submit"]').first();
      if (await confirmButton.isVisible()) {
        await confirmButton.click();
        await page.waitForTimeout(1000);
      }

      console.log(`âœ… Added ${game} with rating 9`);

      // Go back to index for next game if needed
      if (i < gamesToAdd.length - 1) {
        await page.goto(`${TARGET_URL}/`);
        await page.waitForTimeout(1000);
      }
    }

    // ===== STEP 3: View Collection =====
    console.log('\nðŸ“š STEP 3: Viewing collection...');

    await page.click('a:has-text("Collection"), a:has-text("COLLECTION")');
    await page.waitForTimeout(2000);

    await page.screenshot({ path: '/tmp/07-collection-final.png', fullPage: true });
    console.log('Current URL:', page.url());
    console.log('âœ… Collection page loaded');

    // Log what's in the collection
    const collectionItems = await page.locator('[class*="card"], article, [data-testid*="game"]').count();
    console.log(`Found ${collectionItems} items in collection`);

    console.log('\nðŸŽ‰ All tasks completed successfully!');
    console.log(`Account created: ${uniqueEmail}`);

  } catch (error) {
    console.error('âŒ Error:', error.message);
    await page.screenshot({ path: '/tmp/error-screenshot.png', fullPage: true });
  } finally {
    await page.waitForTimeout(2000);
    await browser.close();
  }
})();

