// Generate unique credentials
const timestamp = Date.now();
const uniqueEmail = `gamer_${timestamp}@securemail.dev`;
const securePassword = `G@m3r_Secure_${timestamp}!`;

(async () => {
  const browser = await chromium.launch({ headless: false, slowMo: 200 });
  const page = await browser.newPage();

  try {
    // ===== STEP 1: Register a new account =====
    console.log('\nðŸ“ STEP 1: Registering new account...');
    console.log(`Email: ${uniqueEmail}`);
    console.log(`Password: ${securePassword}`);

    await page.goto(`${TARGET_URL}/login`);
    await page.waitForTimeout(1000);

    // Click Register tab
    await page.click('button:has-text("Register")');
    await page.waitForTimeout(500);

    // Fill registration form
    await page.fill('input[type="email"]', uniqueEmail);
    await page.fill('input[type="password"]', securePassword);

    await page.screenshot({ path: '/tmp/01-register-form.png', fullPage: true });

    // Submit registration - button text changes to "CREATE ACCOUNT" on register tab
    await page.click('button:has-text("Create Account")');
    await page.waitForTimeout(3000);

    await page.screenshot({ path: '/tmp/02-after-register.png', fullPage: true });
    console.log('âœ… Registration submitted');
    console.log('Current URL:', page.url());

    // ===== STEP 2: Navigate to Index to add games =====
    console.log('\nðŸŽ® STEP 2: Navigating to Index page...');

    // Click on Index link
    await page.click('a:has-text("Index")');
    await page.waitForTimeout(2000);
    await page.screenshot({ path: '/tmp/03-index-page.png', fullPage: true });
    console.log('Index page URL:', page.url());

    // Explore the page structure
    const buttons = await page.locator('button').allTextContents();
    console.log('Available buttons:', buttons);

    const inputs = await page.locator('input').all();
    console.log('Number of inputs:', inputs.length);
    for (const input of inputs) {
      const placeholder = await input.getAttribute('placeholder');
      const type = await input.getAttribute('type');
      console.log('Input:', { type, placeholder });
    }

    // Look for game items
    const gameItems = await page.locator('[class*="game"], [class*="card"], article, li').count();
