    await page.screenshot({ path: '/tmp/01-register.png', fullPage: true });

    // Submit registration
    await page.click('button:has-text("Create Account")');
    await page.waitForTimeout(3000);

    console.log('âœ… Account created successfully');
    console.log('Current URL:', page.url());

    // ===== STEP 2: Add 5 games with rating 9 =====
    console.log('\n========================================');
    console.log('ðŸŽ® STEP 2: Adding 5 games with rating 9');
    console.log('========================================');

    const gamesToAdd = [
      { search: 'zelda', name: 'THE LEGEND OF ZELDA' },
      { search: 'mario galaxy', name: 'SUPER MARIO GALAXY' },
      { search: 'final fantasy', name: 'FINAL FANTASY' },
      { search: 'metal gear solid', name: 'METAL GEAR SOLID' },
      { search: 'dark souls', name: 'DARK SOULS' }
    ];

    for (let i = 0; i < gamesToAdd.length; i++) {
      const game = gamesToAdd[i];
      console.log(`\n--- Game ${i + 1}/5: ${game.name} ---`);

      // Go to index page
      await page.goto(TARGET_URL);
      await page.waitForTimeout(1500);

      // Search for the game
      const searchInput = page.locator('input[type="text"]').first();
      await searchInput.fill(game.search);
      await page.waitForTimeout(2000);

      // Click on the game result
      const gameRow = page.locator(`text=${game.name}`).first();
      await gameRow.click();
      await page.waitForTimeout(1000);

      // Wait for the modal/dialog to appear
      await page.waitForSelector('[role="dialog"], [class*="modal"], [class*="dialog"]', { timeout: 5000 }).catch(() => {});
      await page.waitForTimeout(500);

      // Find the slider and set it to 9
      // The slider is an input[type="range"] with min=0, max=10
      const slider = page.locator('input[type="range"]');

      if (await slider.count() > 0) {
        // Get the slider's bounding box to calculate click position
        const sliderBox = await slider.boundingBox();

        if (sliderBox) {
          // Calculate position for value 9 (90% of the way)
          // The slider goes from 0 to 10, so 9 is at 90%
          const targetX = sliderBox.x + (sliderBox.width * 0.9);
          const targetY = sliderBox.y + (sliderBox.height / 2);

          // Click and drag to the correct position
          await page.mouse.click(targetX, targetY);
          await page.waitForTimeout(300);

          // Verify the value by checking the displayed number
          const ratingDisplay = await page.locator('text=/^[0-9]$|^10$/').first().textContent().catch(() => 'unknown');
          console.log(`Rating display shows: ${ratingDisplay}`);
        }

        // Alternative: directly set the value using JavaScript
        await slider.evaluate((el) => {
          el.value = '9';
          el.dispatchEvent(new Event('input', { bubbles: true }));
          el.dispatchEvent(new Event('change', { bubbles: true }));
        });
        await page.waitForTimeout(300);
      }

      await page.screenshot({ path: `/tmp/02-game-${i + 1}-rated.png`, fullPage: true });

      // Click Confirm Entry
      await page.click('button:has-text("Confirm Entry")');
      await page.waitForTimeout(1500);

      console.log(`âœ… Added ${game.name}`);
    }

    // ===== STEP 3: View Collection =====
    console.log('\n========================================');
    console.log('ðŸ“š STEP 3: Viewing collection');
    console.log('========================================');

    await page.click('a:has-text("Collection"), a:has-text("COLLECTION")');
    await page.waitForTimeout(2000);

    await page.screenshot({ path: '/tmp/03-collection-final.png', fullPage: true });
    console.log('Collection URL:', page.url());

    // Get and display collection stats
    const statsText = await page.locator('body').innerText();

    // Look for the stats
    const totalItemsMatch = statsText.match(/(\d+)\s*TOTAL ITEMS/i);
    const avgScoreMatch = statsText.match(/(\d+\.?\d*)\s*AVG SCORE/i);

    if (totalItemsMatch) console.log(`Total Items: ${totalItemsMatch[1]}`);
    if (avgScoreMatch) console.log(`Average Score: ${avgScoreMatch[1]}`);

    // List the games in collection
    console.log('\nGames in collection:');
    for (const game of gamesToAdd) {
      if (statsText.includes(game.name)) {
        console.log(`  âœ“ ${game.name}`);
      }
    }

    console.log('\n========================================');
    console.log('ðŸŽ‰ ALL TASKS COMPLETED!');
    console.log('========================================');
    console.log(`\nAccount credentials:`);
    console.log(`  Email: ${uniqueEmail}`);
    console.log(`  Password: ${securePassword}`);

  } catch (error) {
    console.error('âŒ Error:', error.message);
    await page.screenshot({ path: '/tmp/error.png', fullPage: true });
  } finally {
    await page.waitForTimeout(3000);
    await browser.close();
  }
})();

